import React, { useState, useRef, FormEvent } from 'react'
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import styles from '../styles/LoginForm.module.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login: React.FC = () => {

    const form = useRef<HTMLFormElement>(null)

    const handleLoginOnSubmit = (e: FormEvent<HTMLFormElement>) => {
        e.preventDefault();

    }

    //noValidate validated={


    return (
        <div className={styles.form_wrapper}>

            <Form ref={form} onSubmit={handleLoginOnSubmit} className={styles.form}>
                <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                    <Form.Label>Email adress</Form.Label>
                    <Form.Control
                        required type="emaill"
                        placeholder="email..."
                        name="from_name"
                    />
                </Form.Group>
                <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                        required type="email"
                        placeholder="Password.."
                        name="to_name"
                    />
                </Form.Group>
                <Button variant="primary" size="lg" type="submit" className="btn">
                    Sign in
                </Button>
            </Form>


        </div>
    )
}

export default Login
